import React from 'react'
import { logOut } from '../../actions'
import { connect } from 'react-redux'

class Logut extends React.Component {

  render () {
    return (
      <div>
       <center> <h2>Logout</h2></center>
       {this.props.logOut()}
      </div>
    )
  }
}

export default connect(null , { logOut })(LogOut)
